import React from "react";
import "../styles/arrow.css";

function PageList(props) {
  if (props.pages && props.pages.length > 0) {
    return (
        props.pages.map((page) => {
          const hasChildren = page.hasOwnProperty("children");
          if (hasChildren) {
            return <div>
              <Page
                id={page.id}
                name={page.name}
                // hasChildren={hasChildren}
                hasChildren={false}
                />
              {hasChildren && <ul>
                <PageList pages={page.children}/>
              </ul>} 
            </div>
          } else {
            return <div>
              <Page
                id={page.id}
                name={page.name}
                // hasChildren={hasChildren}
                hasChildren={false}
                />
            </div>
          }
        })
    )
  } else {
    return (<div></div>);
  }
}

function Page({id, name, hasChildren}) {
  return <li key={id} className={hasChildren? 'arrow-down' : null}>{name}</li>
}

export default PageList;
